import React, { useEffect, useState } from 'react';
import axios from 'axios';
import qs from 'qs';
import { dbPost } from './Admin';

export default function Admin2(props) {
    const [arr, setArr] = useState([]);
    const [id, setId] = useState(1);
    function submitUpdateMenuItem(e) {
        const form = e.target;
        const inputs = {
            mid: form.elements['mid'].value,
            mi_name: form.elements['mi_name'].value,
            restaurant: form.elements['restaurant'].value,
            price: form.elements['price'].value,
            size1: form.elements['size1'].value,
            size2: form.elements['size2'].value,
            size3: form.elements['size3'].value,
            size4: form.elements['size4'].value,
        };
        console.log(inputs)
        dbPost(e, form, inputs, "updateMenuItem");
    }
    useEffect(() => {
        axios.get('http://localhost:3000/api/menu/item',
                { params: { menuItem: id } }).then(res => {
            console.log(res.data);
            setArr(res.data);
        });
    }, [id, setId, setArr]);
    function changeId(e) {
        console.log(e.target.value);
        setId(e.target.value);
        const newArr = arr.map((m) => {
            return m
        });
        setArr(newArr);
    }
    return(
        <form onSubmit={(e) => submitUpdateMenuItem(e)}>
            {
                arr.map((mi, key) => {
                    const [name, setName] = useState(mi.name);
                    const [price, setPrice] = useState(mi.price);
                    const [size1, setSize1] = useState(mi.size1);
                    const [size2, setSize2] = useState(mi.size2);
                    const [size3, setSize3] = useState(mi.size3);
                    const [size4, setSize4] = useState(mi.size4);
                    const [restaurant, setRestaurant] = useState(mi.restaurant);
                    return (
                        <div className="row m-3" key={key}>
                            <h2>Update Menu Item</h2>
                            <div className="col-sm-3">
                                <label>ID: </label>
                                <input
                                    name="mid"
                                    defaultValue={mi.id}
                                    className="form-control"
                                    onChange={(e) => changeId(e)}
                                    type="number" />
                            </div>
                            <div className="col-sm-6">
                                <label>Name: </label>
                                <input
                                    name="mi_name"
                                    defaultValue={name}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Price: </label>
                                <input
                                    name="price"
                                    defaultValue={price}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Size1: </label>
                                <input
                                    name="size1"
                                    defaultValue={size1}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Size2: </label>
                                <input
                                    name="size2"
                                    defaultValue={size2}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Size3: </label>
                                <input
                                    name="size3"
                                    defaultValue={size3}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Size4: </label>
                                <input
                                    name="size4"
                                    defaultValue={size4}
                                    className="form-control"
                                    type="text" />
                            </div>
                            <div className="col-sm-3">
                                <label>Restaurant: </label>
                                <input
                                    name="restaurant"
                                    defaultValue={restaurant}
                                    className="form-control"
                                    type="number" />
                            </div>
                            <div className="col-sm-4">
                                <br />
                                <input
                                    type="submit"
                                    className="btn btn-primary form-control"
                                />
                            </div>
                        </div>
                    );
                })
            }
        </form>
    )
}
